import React from 'react';
import ReactDOM from 'react-dom';
import ProfileLoader from './profile.js';
import ImgLoader from './img_profile.js';
import { Paper } from '@material-ui/core';
import { Grid } from '@material-ui/core';
import { Box } from '@material-ui/core';
import { GridList } from '@material-ui/core';
import { GridListTile } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import img1 from './static/qiuqiu_img/qiuqiu.jpg';
import img2 from './static/qiuqiu_img/qiuqiu1.jpg';
import img3 from './static/qiuqiu_img/qiuqiu2.jpg';



class MyView extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			msg: '仲qiuqiu'
		}
	}

	render() {
		let classes;
		classes = makeStyles(theme => ({
			root: {
				display: 'flex',
				flexWrap: 'wrap',
				justifyContent: 'space-around',
				overflow: 'hidden',
				backgroundColor: theme.palette.background.paper,
			},
			gridList: {
				flexWrap: 'nowrap',
				transform: 'translateZ(0)',
				},
			}));

		return (
			<div className={classes.root}>
				<GridList className={classes.gridList} cols={2.5}>
					<GridListTile key={img1}>
						<img src={img1} />
					</GridListTile>
					<GridListTile key={img2}>
						<img src={img2} />
					</GridListTile>
					<GridListTile key={img3}>
						<img src={img3} />
					</GridListTile>
				</GridList>
			</div>
		);
	}
}


// ========================================


ReactDOM.render(
	<MyView/>,
	document.getElementById('root'),	
);
